import React from 'react'


export default function Search() {
    return (
        <div>
           <div class="input-group">
            <input className="form-control border-end-0 border rounded-pill" type="text" value="search" id="example-search-input" 
            style={{"backgroundColor": 'rgba(60, 64, 67, 0.1)', 'border': '1px solid black', 'outline': 'none'}}/>
         </div> 
        </div>
    )
}
